import React from 'react';
import {NavigationContainer} from '@react-navigation/native';
import {createStackNavigator} from '@react-navigation/stack';

import Home from "./components/Home"
import Locations from "./components/Locations";
import Map from "./components/Map";

const Stack = createStackNavigator();

function App() {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen
                    name="Home"
                    component={Home}
                    options={{
                        title: 'Map Node App',
                        headerStyle: {
                            backgroundColor: '#ff0000',
                        },
                        headerTintColor: '#ffffff',
                        headerTitleStyle: {
                            fontWeight: 'bold',
                            textAlign: 'center'
                        },
                    }}/>
                <Stack.Screen
                    name="Locations"
                    component={Locations}
                    options={{
                        title: 'Locations',
                        headerStyle: {
                            backgroundColor: '#ff0000',
                        },
                        headerTintColor: '#ffffff',
                        headerTitleStyle: {
                            fontWeight: 'bold',
                            textAlign: 'center'
                        },
                    }}/>
                <Stack.Screen
                    name="Map"
                    component={Map}
                    options={{
                        title: 'Map',
                        headerStyle: {
                            backgroundColor: '#ff0000',
                        },
                        headerTintColor: '#ffffff',
                        headerTitleStyle: {
                            fontWeight: 'bold',
                            textAlign: 'center'
                        },
                    }}/>
            </Stack.Navigator>
        </NavigationContainer>
    );
}

export default App;
